(7, 'Binibini', 4, '<div class=\"Lyrics__Container-sc-1ynbvzw-6 jYfhrf\" data-lyrics-container=\"true\">[Verse 1]<br />You give me hope<br />For strength, the will to keep on<br />No one else can make me feel this way<br />And only you can bring out all the best I can do<br />I believe you turned the tide<br />And make me feel real good inside<br /><br />[Verse 2]<br />You pushed me up<br />When I\'m about to give up<br />You\'re on my side<br />When no one seems to listen<br />And if you go, you know the tears can\'t help but show<br />You\'ll break this heart and tear it apart<br />And suddenly the madness starts<br /><br />[Chorus]<br />It\'s your smile, your face, your lips that I miss<br />Those sweet little eyes that stare at me<br />And make me say, I\'m with you through all the way<br />\'Cause it\'s you who fills the emptiness in me<br />It changes everything you see<br />When I know I\'ve got you with me<br /><br />[Verse 3]<br />You pushed me up<br />When I\'m about to give up<br />You\'re on my side<br />When no one seems to listen<br />And if you go, you know the tears can\'t help but show<br />You\'ll break this heart and tear it apart<br />And suddenly the madness starts</div>\r\n<div class=\"RightSidebar__Container-pajcl2-0 kwgaZp\">&nbsp;</div>\r\n<div class=\"InreadAddesktop__Container-j86wd6-0 focHlE\">&nbsp;</div>\r\n<div class=\"Lyrics__Container-sc-1ynbvzw-6 jYfhrf\" data-lyrics-container=\"true\">[Chorus]<br />It\'s your smile, your face, your lips that I miss<br />Those sweet little eyes that stare at me<br />And make me say, I\'m with you through all the way<br />\'Cause it\'s you who fills the emptiness in me<br />It changes everything you see<br />When I know I\'ve got you with me<br /><br />It\'s your smile, your face, your lips that I miss<br />Those sweet little eyes that stare at me<br />And make me say, I\'m with you through all the way<br />\'Cause it\'s you who fills the emptiness in me<br />It changes everything you see<br />When I know I\'ve got you with me</div>', 'upbeat', 'foreign', '2022-02-12 14:37:23'),
